import React from 'react';
import { MapContainer, TileLayer, Marker, Popup, CircleMarker } from 'react-leaflet';
import { useNavigate } from 'react-router-dom';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

// Fix for marker icon not displaying
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

// Custom marker icons
const createMarkerIcon = (color) => {
  return L.divIcon({
    className: 'custom-marker',
    html: `<div style="background-color: ${color}; width: 24px; height: 24px; border-radius: 50%; border: 2px solid white;"></div>`,
    iconSize: [25, 25],
    iconAnchor: [12, 12],
  });
};

const parkingLots = [
  {
    id: 1,
    name: 'Perry Street Garage',
    position: [37.2312, -80.4263],
    availableSpots: 45,
    totalSpots: 120,
    status: 'Some Open',
  },
  {
    id: 2,
    name: 'Cassell Lot',
    position: [37.2214, -80.4205],
    availableSpots: 0,
    totalSpots: 80,
    status: 'Full',
  },
  {
    id: 3,
    name: 'Litton Reaves',
    position: [37.2220, -80.4267],
    availableSpots: 35,
    totalSpots: 60,
    status: 'Available',
  },
  {
    id: 4,
    name: 'Squires',
    position: [37.2291, -80.4168],
    availableSpots: 5,
    totalSpots: 40,
    status: 'Some Open',
  },
  {
    id: 5,
    name: 'Architecture Annex',
    position: [37.2283, -80.4158],
    availableSpots: 20,
    totalSpots: 30,
    status: 'Available',
  },
];

const getMarkerColor = (status) => {
  switch (status) {
    case 'Full':
      return 'red';
    case 'Some Open':
      return 'yellow';
    case 'Available':
      return 'green';
    default:
      return 'blue';
  }
};

const InteractiveMap = () => {
  const navigate = useNavigate();
  const handleMarkerClick = (id) => {
    // Navigate to the page for the parking lot
    navigate(`/parking-lots/${id}`);
  };

  return (
    <div style={styles.mapContainer}>
      <MapContainer 
        center={[37.225, -80.423]} 
        zoom={14.6} 
        style={{ height: '400px', width: '100%', borderRadius: '4px' }}
      >
        <TileLayer
          attribution='&copy; <a href="https://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />

        {parkingLots.map((lot) => (
          <Marker
            key={lot.id}
            position={lot.position}
            icon={createMarkerIcon(getMarkerColor(lot.status))}
            eventHandlers={{
              click: () => {
                handleMarkerClick(lot.id);
              },
            }}
          >
            <Popup>
              <div style={styles.popup}>
                <h3 style={styles.popupTitle}>{lot.name}</h3>
                <p style={styles.popupInfo}>
                  Available: {lot.availableSpots}/{lot.totalSpots}
                </p>
                <p style={styles.popupStatus}>
                  Status: <span style={{
                    color: getMarkerColor(lot.status),
                    fontWeight: 'bold'
                  }}>
                    {lot.status}
                  </span>
                </p>
                <button 
                  onClick={() => handleMarkerClick(lot.id)} 
                  style={styles.popupButton}
                >
                  View Details
                </button>
              </div>
            </Popup>
          </Marker>
        ))}

        {/* VT Campus boundary */}
        <CircleMarker 
          center={[37.226, -80.421]} 
          radius={400} 
          pathOptions={{ 
            fillColor: '#800000', 
            fillOpacity: 0.1, 
            color: '#800000', 
            weight: 1 
          }} 
        />
      </MapContainer>
    </div>
  );
};

const styles = {
  mapContainer: {
    width: '100%',
    height: '100%',
    borderRadius: '4px',
    overflow: 'hidden',
    boxShadow: '0 2px 4px rgba(0, 0, 0, 0.2)',
  },
  popup: {
    textAlign: 'center',
    padding: '5px',
    minWidth: '150px',
  },
  popupTitle: {
    margin: '0 0 5px 0',
    color: '#800000',
  },
  popupInfo: {
    margin: '5px 0',
    fontSize: '14px',
  },
  popupStatus: {
    margin: '5px 0',
    fontSize: '14px',
  },
  popupButton: {
    backgroundColor: '#800000',
    color: 'white',
    border: 'none',
    padding: '5px 10px',
    borderRadius: '4px',
    cursor: 'pointer',
    marginTop: '5px',
    fontWeight: 'bold',
  },
};

export default InteractiveMap;
